import React from 'react'
import {Row, Col, Card} from 'react-bootstrap'
import products from '../products'


const HomeScreen = () => {
  return (
    <>   
     <Row>
        {products.forEach((product) => {
            <Col sm={12} md={6} lg={4} xl={3}>
                {console.log(product.name)}
                <h1>{product.name}</h1>
            </Col>
        })}
     </Row>
    </>
  )
}

export default HomeScreen
